  const [bad, setBad] = useState(0)

  const posiMaara = 0
  const neutMaara = 0
  const negaMaara = 0


  return (
    <div>
      <Title />
      <Button good = {[good, setGood]} /> <Button /> <Button />
      <Show posi={posiMaara} neut={neutMaara} nega={negaMaara} />
    </div>
  )
}

const Title = () => {
  return (
    <h1>Give Feedback</h1>
  )


}



const Button = ({text, onClick}) => {
  return (
    <button onClick={onClick}>
      {text}
    </button>

  )

}

const Show = (props) => {
  return (

    <div>
      <h1>Statistics</h1>
      <p>good  {props.posi}</p>
      <p>neutral {props.neut}</p>
      <p>bad {props.nega}</p>
      <p>all {props.posi + props.nega + props.neut}</p>
    </div>
  )
}


ReactDOM.render(<App />,
  document.getElementById('root')
)
